import { useNavigate } from "react-router-dom";

function VerifiedHeader() {
  const navigate = useNavigate();

  function handleLogo() {
    navigate("/");
  }
  function handleAccount() {
    navigate("/account");
  }
  function handleProfile() {
    navigate("/dashboard");
  }

  return (
    <Navbar bg="light" expand="lg">
      <Navbar.Brand onClick={handleLogo} className="logo focus">
        <span className="green-text">Spotify</span>Stats
      </Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="mr-auto">
          <Nav.Link onClick={handleAccount}>Account</Nav.Link>
          <Nav.Link onClick={handleProfile}>Profile</Nav.Link>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
}

export default VerifiedHeader;
